import base64
from typing import List

# BOF imports
from core.gunnershell.bofs.base import Bof, register

from colorama import Style, Fore
brightgreen = "\001" + Style.BRIGHT + Fore.GREEN + "\002"
brightyellow = "\001" + Style.BRIGHT + Fore.YELLOW + "\002"
reset = Style.RESET_ALL

@register("enablerdp")
class EnableRDPBof(Bof):
	base64bof: str = ""
	x86base64bof: str = ""

	def help_menu():
		menu = """
enablerdp — Enable Remote Desktop + Firewall Rules
===================================================

Configure the system to allow inbound RDP connections with NLA, ensure the 
Terminal Services service is running, and add firewall rules for TCP/UDP 3389.

USAGE
  bofexec enablerdp

WHAT IT DOES
  - Sets registry keys:
      HKLM\\SYSTEM\\CurrentControlSet\\Control\\Terminal Server
          fDenyTSConnections = 0   (enable RDP)
      HKLM\\SYSTEM\\CurrentControlSet\\Control\\Terminal Server\\WinStations\\RDP-Tcp
          UserAuthentication  = 1  (enable NLA)

  - Ensures TermService is running:
      Starts the "Remote Desktop Services" service if stopped.

  - Configures firewall rules via COM (INetFwPolicy2):
      * Adds "Mgmt RDP TCP-In" (TCP/3389)
      * Adds "Mgmt RDP UDP-In" (UDP/3389)
      * Enables built-in "Remote Desktop" rule group for all profiles

  Notes:
    - Pure API/COM calls (no external tools, no child processes).
    - Will not duplicate firewall rules if they already exist.

REQUIREMENTS
  - Windows Vista / Server 2008 or later (_WIN32_WINNT >= 0x0600)
  - Administrator or SYSTEM privileges (required for registry and firewall changes)
  - COM available (OLE32 / OLEAUT32)

TROUBLESHOOTING
  - “Failed setting fDenyTSConnections”  
      No write access to HKLM\\SYSTEM\\… registry path. Try elevated context.

  - “TermService not running and could not be started”  
      Service disabled or lacking permissions; check Service Control Manager config.

  - “CoCreateInstance(NetFwPolicy2) failed”  
      COM subsystem blocked or unavailable; ensure OLE32 initialization succeeds.

  - “Could not add TCP/UDP rule”  
      Firewall policy prevents new rules, or they already exist.
"""
		print(brightgreen + menu + reset)
		return